import React from 'react'

interface WeatherProps {
  temperature: number
  scale: 'C' | 'F'
}

export const Weather: React.FC<WeatherProps> = ({ temperature, scale }) => {
  return (
    <div>
      The temperature is {temperature} {scale}
    </div>
  )
}
